import logo from './logo.svg';
import './App.css';
import React from 'react';
import { Route, Routes } from 'react-router';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<App />}></Route>
        <Route path="/home" element={<App />}></Route>
      </Routes>
    </div>
  );
}

export default App;
